/*
@param string key : la clé de l'objet GAME_ICONS
@param object opt :{
    fill : #fff; la couleur de remplissage
    ,classe:empty; la classe du svg
}

*/
const getSVGIcon=(key,opt={})=>{
    let ico='';
    console.log(key)
    if(GAME_ICONS[key]){
        let classe=opt.classe?`class="${opt.classe}"`:'';
        let fill=opt.fill?opt.fill:'#fff';
        
        ico=`
        <svg ${classe} viewBox="0 0 512 512">
            <g><path d="${GAME_ICONS[key]}" fill="${fill}"></path></g>
        </svg>`;        
    }
    return ico;
}